import React from "react";

function Trasaction(props) {
  return (
    <div>
      <div>
        <span className="id">{props.transactionId}</span>
        <span className="description">{props.transferDetails}</span>
        <span>{props.amountTransfered}</span>
        <span>{props.transferDate}</span>
        <span>{props.balance}</span>
      </div>
    </div>
  );
}
export default Trasaction;
